import React from 'react';
import { useState } from 'react';
import { Link } from 'react-router-dom';
import GenreCard from './GenreCard';
import axios from 'axios'


function Genre() {

  // loop through the array
  const [genresData, setGenresData] = useState({
    "Genres": [
      {
        "genreId": "1",
        "name": "GenreName",
        "popularArtists": ["Artists 1", "Artists 2", "Artists 3"],
        "upcomingEvents": ["Event 1", "Event 2", "Event 3", "Event 4"],
        "topSongs": ["Song 1", "Song 2", "Song 3"],
        "eventsPriceRange": [0, 0]
      },
      {
        "genreId": "2",
        "name": "GenreName 2",
        "popularArtistsId": ["Artists 1", "Artists 2", "Artists 3"],
        "upcomingEventsId": ["Event 1", "Event 2", "Event 3", "Event 4"],
        "topSongs": ["Song 1", "Song 2", "Song 3"],
        "eventsPriceRange": [0, 0]
      }
    ]
  });
  // genresData = axios.get("/api/GetAllGenres/").then(res =>
  //   console.log(res)
  // ).catch(err => console.log(err))

  return (
    <>

      <h1 class="m-5">Genres</h1>
      <div class="row d-flex justify-content-center genre-card-container ">
        {
          genresData["Genres"].map((genre, index) => (
            <GenreCard key={index}
              genreId={genre.genreId}
              name={genre.name}
              popularArtists={genre.popularArtistsId}
              upcomingEvents={genre.upcomingEventsId}
              topSongs={genre.topSongs}
              eventsPriceRange={genre.eventsPriceRange}
            />
          ))

        }

        {/* <GenreCard name={""} popularArtists={[]} upcomingEvents={[]} topSongs={[]} eventsPriceRange={[]}></GenreCard> */}


      </div>

    </>

  );
}

export default Genre;
